import styled from 'styled-components';

export const Button = styled.div` 
   position: fixed;  
   width: 100%; 
   text-justify: right;
   bottom: 40px; 
   height: 20px; 
   font-size: 3rem; 
   z-index: 1; 
   cursor: pointer; 
   color: rgb(254, 255, 172); 
`
